import React from 'react';
import './formulario.css';

const Menu = () => {
  return (
  <menu className="nav">
    <nav className="navbar">
        <a href="./index.html">Inicio</a>
        <a href="CrearEvento.html">Eventos</a>
        <a href="CrearTipo.html">Tipo de evento</a>
        <a href="competencias.php">Competencias</a>
    </nav>
  </menu>
  );
};

export default Menu;
